function isEmpty(data){
    if (typeof(data)=='object' & data!=null){
        return  !Object.keys(data).length==0
    } else if (data==null) {
        return false
    } else if (typeof(data)=='boolean'){
        return true
    }
    else {
        return !data==false
    }
}

